import React from 'react';
import "./styles.scss";

export class LaunchImage extends React.Component{
    constructor(){
        super();
        this.state = {
            showImages: false
        }
    }
    render(){
        return(
            <>
                <img src={this.props.links.mission_patch} alt="mission patch" className="launchImg"></img>
                {this.props.links.flickr_images.length>0 &&
                <img src={this.props.links.flickr_images[0]} alt="flickr" className="launchImg"></img>
                }

            </>
        );
    }
}
